Oscar Diggs (James Franco), een eigenaardige circusartiest die zich bezighoudt met tovenarij, wordt uit Ã¢â‚¬â„¢t stoffige stadje Kansas gegooid en besluit het in te ruilen voor het magistrale Land van Oz. Eenmaal aangekomen blijkt roem en fortuin voor het rapen te liggen, totdat hij drie heksen ontmoet: Theodora (Mila Kunis), Evanora (Rachel Weiz) en Glinda (Michelle Williams). Zij zijn er niet van overtuigd dat Oscar de geweldige tovenaar is die hij beweert te zijn. Zijn bekwaamheid wordt op de proef gesteld wanneer het Land van Oz en zijn inwoners onder kwaadaardige dreiging komt te staan. Door middel van ingenieuze illusies en zelfs een beetje echte tovenarij, weet Oscar niet alleen in een echte tovenaar te veranderen maar ook in betere man. Gebaseerd op L. Frank Baum's geliefde karakter, de tovenaar van Oz.



